import { useState, useContext} from 'react';
import Filter from './components/filter/Filter';
import Dashboard from './components/dashboard/Dashboard';
import { ContextFilter } from './components/filter/ContextFilter';
import { ContextDashboard } from './components/dashboard/ContextDashboard';
import Axios from 'axios';
import GetData from './api/app';

function App() {
	const { stateStart, 
			stateEnd, 
			valueInitialStore, 
			stateCurrentStore, 
			stateVisible, 
			funcDisableFilters, 
			funEnableFilters
	 } = useContext(ContextFilter);
	const [startDate, setStartDate] = stateStart;
	const [endDate, setEndDate] = stateEnd;
	const defaultStore = valueInitialStore;
	const [newSelectedStore, setNewSelectedStore] = stateCurrentStore;
	const currentVisibleStatus = stateVisible[0];

	const { data } = useContext(ContextDashboard);
	const [newData, setNewData] = data;

	async function test() {
		let a = await GetData();
		setNewData(a.data.results[0]);
	};


	return (
		<div className="App">
			<Filter />
			<Dashboard />
			<button onClick={ funcDisableFilters }>Set Disable</button>
			<button onClick={ funEnableFilters }>Set Enable</button>
			<p>Visible Status: { currentVisibleStatus }</p>
			<button onClick={ test }>Filter</button>
			<p> Default(URL) Store: {defaultStore}</p>
			<p> Selected Store: {newSelectedStore}</p>
		</div>
	  );
}

export default App;
